const storyEl = document.getElementById('story');
const choicesEl = document.getElementById('choices');
const imageEl = document.getElementById('image');

function render(key){
  const node = story[key];
  if(!node) return;
  imageEl.innerHTML = "";
  const img = document.createElement('img');
  img.src = node.image;
  img.alt = "Scene image";
  imageEl.appendChild(img);

  storyEl.textContent = node.text;
  choicesEl.innerHTML = "";
  if(node.ending){
    const p = document.createElement('p'); p.className='small fade-in'; p.textContent=node.endingText; storyEl.appendChild(p);
    const restart = document.createElement('button'); restart.className='choice secondary'; restart.textContent='Restart Adventure'; restart.addEventListener('click',()=>render('start')); choicesEl.appendChild(restart);
  } else {
    node.choices.forEach((c, i)=>{ const b=document.createElement('button'); b.className='choice fade-in'+(i%2?' secondary':''); b.textContent=(i+1)+'. '+c.label; b.addEventListener('click',()=>render(c.goto)); choicesEl.appendChild(b); });
  }
}
document.addEventListener('keydown',(e)=>{const n=parseInt(e.key,10); if(!isNaN(n)&&n>=1&&n<=choicesEl.children.length){choicesEl.children[n-1].click();}});
window.addEventListener('DOMContentLoaded',()=>render('start'));
